import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Searchpage from './Searchpage';
import ProfilePage from './ProfilePage';
import SignOutPage from './SignOutPage';

const App = () => {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/profile">
            <ProfilePage />
          </Route>
          <Route path="/signout">
            <SignOutPage />
          </Route>
          <Route path="/">
            <Searchpage />
          </Route>
        </Routes>
      </div>
    </Router>
  );
};

export default App;
